// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract IBNB {
    function balanceOf(address account) public view returns (uint256) {}
    function transfer(address to, uint256 amount) public returns (bool) {}
    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public returns (bool) {} 
    function allowance(address owner, address spender) public view  returns (uint256) {}
    function approve(address spender, uint256 amount) public returns (bool) {}
}

contract SweetToken is ERC20, Ownable {

    constructor() ERC20("SweetToken", "SWEET") {}

    function mint(address _to, uint256 _amount) public onlyOwner {
        _mint(_to, _amount);
    }

    function burn(address _from, uint256 _amount) public onlyOwner {
        _burn(_from, _amount);
    }
}

contract Factory {

    address public owner ;

    SweetToken public sweetToken ;
    constructor(){
        sweetToken = new SweetToken() ;
        owner = msg.sender ;
    }
    IBNB BNB = IBNB(0xB8c77482e45F1F44dE1745F52C74426C631bDD52) ;

    mapping(address => uint ) balance ;
    mapping(address => uint ) withdrawalTime ;

    // user should approve the amount befor calling this function 
    function deposit(uint _amount ) public {
        require( BNB.allowance(msg.sender , address(this)) >= _amount ,"insufficiant allowance!" );
        BNB.transferFrom(msg.sender,address(this),_amount) ;
        updateBalance(_amount);
        sweetToken.mint(msg.sender, _amount * 10);
    }

    function updateBalance(uint _amount) private {
        balance[msg.sender] += _amount ;
        // withdrawalTime[msg.sender] = block.timestamp + 7 days ;
        withdrawalTime[msg.sender] = block.timestamp + 1 minutes ;  // just for test!

    }

    modifier checkWithdrawal(){
        require(balance[msg.sender] > 0 ,"You havn't deposited any BNB token! ");
        require(block.timestamp >= withdrawalTime[msg.sender],"please wait more! ");
        _;
    }
    
    function redeem() public checkWithdrawal {
        sweetToken.burn(msg.sender,balance[msg.sender] * 10) ;
        BNB.transfer(msg.sender,balance[msg.sender]) ;
    }
    function BNBbalance(address _addr) public view returns(uint){
        return BNB.balanceOf(_addr);    
    }

}
